import {createReducer} from "@reduxjs/toolkit";




const initialState = {
    savedCities: ['Moscow', 'Barcelona', 'Haifa', 'New York', 'Podolsk', 'Canberra'],
};

const citiesReducer = createReducer(initialState, {
    'ADD_CITY': (state) => {
        return state;
    },

})

export default citiesReducer;
